description:
La liste des collèges référencés dans OpenStreetMap en utilisant la requète overpass suivante :
<pre>
/*
This has been generated by the overpass-turbo wizard.
The original search was:
“school:FR=collège en Gironde”
*/
[out:json][timeout:25];
// fetch area “Gironde” to search in
{{geocodeArea:Gironde}}->.searchArea;
// gather results
(
  // query part for: “school:FR=collège”
  node["school:FR"="collège"](area.searchArea);
  way["school:FR"="collège"](area.searchArea);
);
// print results
out body;
>;
out skel qt;
<code>
Mise à jour automatique [ici](http://overpass-api.de/api/interpreter?data=%2F*%0AThis%20has%20been%20generated%20by%20the%20overpass-turbo%20wizard.%0AThe%20original%20search%20was%3A%0A%E2%80%9Cschool%3AFR%3Dcoll%C3%A8ge%20en%20Gironde%E2%80%9D%0A*%2F%0A[out%3Ajson][timeout%3A25]%3B%0A%2F%2F%20fetch%20area%20%E2%80%9CGironde%E2%80%9D%20to%20search%20in%0Aarea%283600007405%29-%3E.searchArea%3B%0A%2F%2F%20gather%20results%0A%28%0A%20%20%2F%2F%20query%20part%20for%3A%20%E2%80%9Cschool%3AFR%3Dcoll%C3%A8ge%E2%80%9D%0A%20%20node[%22school%3AFR%22%3D%22coll%C3%A8ge%22]%28area.searchArea%29%3B%0A%20%20way[%22school%3AFR%22%3D%22coll%C3%A8ge%22]%28area.searchArea%29%3B%0A%29%3B%0A%2F%2F%20print%20results%0Aout%20body%3B%0A%3E%3B%0Aout%20skel%20qt%3B "Adresse overpass pour la mise à jour")

Pour chaque thème
- 1 fichier de données (format CSV) pour les établissements ayant participé ;
- 1 fichier lexique (format CSV) présentant le code et le libellé des champs ;
- 1 fichier d’explication (format PDF) sur les indicateurs du thème.
Les réutilisateurs peuvent s’inspirer du document de bonnes pratiques de la HAS : « [Guide méthodologique sur la diffusion publique des résultats d'indicateurs de qualité et de sécurité des soins](https://www.has-sante.fr/portail/jcms/c_1298445/fr/guide-methodologique-sur-la-diffusion-publique-des-resultats-d-indicateurs-de-qualite-et-de-securite-des-soins-septembre-2012) » (sept. 2012)

Le questionnaire e-Satis +48h MCO est mis à disposition, en ligne, pour recueillir l'expérience et la satisfaction des patients de façon continue auprès de tous les patients hospitalisés plus de 48 heures en médecine, chirurgie ou obstétrique (MCO).
Il permet au patient de donner son avis sur l’ensemble des étapes de son parcours dans l’établissement de santé :
- son accueil : accessibilité, livret d’accueil, identification du personnel, horaires de visite, … ;
- sa prise en charge : information, décision médicale partagée, délais d’attente, respect de l’intimité/confidentialité, écoute et soutien, gestion de la douleur, … ;
- sa chambre et ses repas ;
- sa sortie : organisation, informations reçues sur les médicaments et les suites, …
